import React, { useState, useEffect } from "react";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import { Button, CardActionArea, CardActions } from "@mui/material";
import background from "./2.jpg";

export default function ServiceUser(props) {
  const [data, setData] = useState({});

  useEffect(() => {
    fetch("http://localhost:3001/users")
      .then((res) => res.json())
      .then((res) => {
        setData(res.users[res.users.length - 1]);
      });
  });

  return (
    <div
      style={{
        backgroundImage: `url(${background})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "100% 100%",
        height: "100vh",
        width: "100%",
      }}
    >
      {" "}
      <Card
        sx={{
          maxWidth: 445,
          maxHeight: 300,
          paddingTop: 3,
          position: "relative",
          top: "20%",
          left: "38%",
          boxShadow: "gray 5px 9px  10px",
        }}
      >
        <CardActionArea>
          <CardContent>
            <Typography gutterBottom variant="h4" component="div">
              First Name :{data.first_name} <br />
              Last Name :{data.last_name}
            </Typography>
            <Typography variant="h6" color="text.secondary">
              {" "}
              Mobile : {data.mob_no} <br />
              Price : {data.price} Rs/-
              <br />
              Service :
            </Typography>
          </CardContent>
        </CardActionArea>

        <CardActions>
          <Button size="large" color="primary">
            Edit Details
          </Button>
          <Button onClick={() => props.history.push("/dashboard")}>
            Dashboard
          </Button>
        </CardActions>
      </Card>
    </div>
  );
}
